
/*
INSERT INTO [c_Procedure] (
 [procedure_id]
      ,[procedure_type]
      ,[procedure_category_id]
      ,[description]
      ,[service]
      ,[units]
      ,[status]
      ,[default_bill_flag]
      ,[bill_flag]
      ,[owner_id]
      ,[definition]
	  )
select distinct 
	substring(replace(
		test_name + case when detail is null then '' 
			when detail = 'Prenatal' or test_name in (
			-- detail on these tests is oriented towards the procedure conditions, not result characterization
			'Glucose', 'Glucose Tolerance', 'SHBG'
				)
				then ' '
				+ case when test_name = 'Glucose Tolerance' then
					case when detail = 'Non-Pregnant 2 hour' then 'NP2H'
						when detail = 'Non-Pregnant Fasting' then 'NPF'
						when detail = 'Pregnant 2 hour' then 'P2H'
						when detail = 'Pregnant Fasting' then 'PF'
						else '' end
					else
						detail
					end
				else '' 
				end
		,' ',''),1,20) as perform_procedure_id,
	'TESTPERFORM',
	'CHEMISTRY',
	test_name + case when detail is null then '' 
		when detail = 'Prenatal' or test_name in (
		-- detail on these tests is oriented towards the procedure conditions, not result characterization
		'Glucose', 'Glucose Tolerance', 'SHBG'
			)
			then ' '
				+ case when detail like 'Vitamin D intoxication has been reported at this level%' 
				then 'Vitamin D intox' else detail end
			else '' 
			end,
	'TEST',
	1,
	'OK',
	'Y',
	'N',
	0,
	test_name + case when detail is null then '' 
		when detail = 'Prenatal' or test_name in (
		-- detail on these tests is oriented towards the procedure conditions, not result characterization
		'Glucose', 'Glucose Tolerance', 'SHBG'
			)
			then ' '
				+ case when detail like 'Vitamin D intoxication has been reported at this level%' 
				then 'Vitamin D intox' else detail end
			else '' 
			end
	from c_Lab_Reference_Range

-- (140 rows affected) DTPHEPB-3DOSE DTPHEPBHIB-3DOSE
*/
